    /**
     * 获取字符串首字母
     *
     * @param characters 字符串
     * @return 首字母
     */
    public static String getFirstLetter(String characters) {
        String str = characters.substring(0, 1);
        if (str.matches("[a-zA-Z]")) {
            return str;
        }
        char c = characters.charAt(0);
        int index = c - START;
        if (index >= 0 && index <= COUNT) {
            return String.valueOf(firstLetterArray.charAt(index));
        }
        return "#";
    }
